    password2: "",
  });

  const { name, email, password, password2 } = formData;

  return (
    <>
      <div className="container">
        <section className="register">
          <h1>Register Here!</h1>
          <p>Create a new Account</p>

          <div className="register__form">
            <form>
              <input
                type="text"
                className="register_name"
                id="name"
                name="name"
              />
            </form>
          </div>
        </section>
      </div>
    </>
  );
};

export default RegisterPage;
